import { Provider } from 'react-redux';
import MainRouter from 'router/MainRouter';
import initStore from './redux/store';
// import generator from "./generator";
import "App.css"
const store = initStore()
function App(props)
{
    return (
        <Provider store={store}>
            <MainRouter />
        </Provider>
    )
}

export default App
